            //利用sort方法进行排序 (常规算法)
            systemSort: function(arr){
                return arr.sort(function(a, b){
                    return a.timestamp - b.timestamp;
                });
            },

            // 冒泡算法算法
            bubbleSort:function(array){
                var i = 0, len = array.length,  
                    j, d;  
                for(; i<len; i++){  
                    for(j=0; j<len; j++){  
                        if(array[i].timestamp < array[j].timestamp){  
                            d = array[j];  
                            array[j] = array[i];  
                            array[i] = d;  
                        }  
                    }  
                }
                return array;  
            },

            // 快速排序算法
            quickSort: function(array) {
                var i = 0;
                var j = array.length - 1;
                var Sort = function(i, j) {

                    // 结束条件
                    if (i == j) {
                        return;
                    }

                    var key = array[i];
                    var stepi = i; // 记录开始位置
                    var stepj = j; // 记录结束位置
                    while (j > i) {
                        // j <<-------------- 向前查找
                        if (array[j] >= key) {
                            j--;
                        } else {
                            array[i] = array[j]
                            //i++ ------------>>向后查找
                            while (j > ++i) {
                                if (array[i] > key) {
                                    array[j] = array[i];
                                    break;
                                }
                            }
                        }
                    }

                    // 如果第一个取出的 key 是最小的数
                    if (stepi == i) {
                        new Sort(++i, stepj);
                        return;
                    }

                    // 最后一个空位留给 key
                    array[i] = key;

                    // 递归
                    new Sort(stepi, i);
                    new Sort(j, stepj);
                }

                Sort(i, j);

                return array;
            },

            // 插入排序算法
            insertSort: function(array) {
                var i = 1,
                j, step, key, len = array.length;

                for (; i < len; i++) {

                    step = j = i;
                    key = array[j];

                    while (--j > -1) {
                        if (array[j] > key) {
                            array[j + 1] = array[j];
                        } else {
                            break;
                        }
                    }

                    array[j + 1] = key;
                }
                return array;
            },

            // 希尔排序算法
            shellSort: function(array) {

                var stepArr = [1750, 701, 301, 132, 57, 23, 10, 4, 1]; // reverse() 在维基上看到这个最优的步长 较小数组
                var i = 0;
                var stepArrLength = stepArr.length;
                var len = array.length;
                var len2 = parseInt(len / 2);

                for (; i < stepArrLength; i++) {
                    if (stepArr[i] > len2) {
                        continue;
                    }
                    stepSort(stepArr[i]);
                }

                // 排序一个步长
                function stepSort(step) {

                    //console.log(step) 使用的步长统计
                    var i = 0,
                    j = 0,
                    f, tem, key;
                    var stepLen = len % step > 0 ? parseInt(len / step) + 1 : len / step;

                    for (; i < step; i++) { // 依次循环列
                        for (j = 1;
                        /*j < stepLen && */
                        step * j + i < len; j++) { //依次循环每列的每行
                            tem = f = step * j + i;
                            key = array[f];

                            while ((tem -= step) >= 0) { // 依次向上查找
                                if (array[tem] > key) {
                                    array[tem + step] = array[tem];
                                } else {
                                    break;
                                }
                            }

                            array[tem + step] = key;

                        }
                    }

                }

                return array;
            }
